ltm rule /Common/app4_pool_rule {
### test rule for corkscrew

  # 

when HTTP_REQUEST {

  # pool reference by variable declaration
  set html-pool web1Pool

  if { [HTTP::path] ends_with "*.css" }{

    # regular pool refernce
    pool css_pool

  } elseif { [HTTP::path] ends_with "*.jpg" }{

    # pool member refernce
    pool jpg.pool member 10.10.10.1 80

  } elseif { [HTTP::path] ends_with "*.js" }{

    # another pool reference with special characters
    pool js.io_t80_pool 

  } elseif { [HTTP::path] ends_with "*.xx" }{

    # pool reference not in tmos config
    ### *** seems the gui won't let you attach an irule to a vs with a pool that doesn't exist
    #pool missing_pool

  } elseif { [HTTP::path] ends_with "*.txt" }{

    # node reference
    node 10.10.10.1 80

  } else {

    # pool referenced by variable
    pool $html-pool

  }
}

ltm policy /Common/app4_ltPolicy {
    controls { forwarding }
    description "testing for pool extraction function"
    requires { http }
    rules {
        css_pool_rule {
            actions {
                0 {
                    forward
                    select
                    pool /Common/css_pool
                }
            }
            conditions {
                0 {
                    http-uri
                    scheme
                    ends-with
                    values { .css }
                }
            }
        }
        jpg_pool_rule {
            actions {
                0 {
                    forward
                    select
                    pool /Common/jpg.pool
                }
            }
            conditions {
                0 {
                    http-uri
                    query-string
                    ends-with
                    values { .jpg }
                }
            }
            ordinal 1
        }
        js_pool_rule {
            actions {
                0 {
                    forward
                    select
                    pool /Common/js.io_t80_pool
                }
            }
            conditions {
                0 {
                    http-uri
                    scheme
                    ends-with
                    values { .js }
                }
            }
            ordinal 2
        }
        txt_node {
            actions {
                0 {
                    forward
                    select
                    node 10.10.10.1
                }
            }
            conditions {
                0 {
                    http-uri
                    scheme
                    ends-with
                    values { .txt }
                }
            }
            ordinal 3
        }
    }
    strategy /Common/first-match
}

